"use strict";(self.webpackChunkcode=self.webpackChunkcode||[]).push([[3099],{3890:a=>{a.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"4","metadata":{"permalink":"/blog/4","editUrl":"https://github.com/lucasbaccan/code/tree/master/blog/2024-06-01-blog-4/index.md","source":"@site/blog/2024-06-01-blog-4/index.md","title":"#4 - Home Lab","description":"Home Lab","date":"2024-06-01T00:00:00.000Z","tags":[{"inline":true,"label":"2023","permalink":"/blog/tags/2023"},{"inline":true,"label":"06/2024","permalink":"/blog/tags/06-2024"},{"inline":true,"label":"Lucas","permalink":"/blog/tags/lucas"},{"inline":true,"label":"Elias","permalink":"/blog/tags/elias"},{"inline":true,"label":"Baccan","permalink":"/blog/tags/baccan"}],"readingTime":4.035,"hasTruncateMarker":true,"authors":[{"name":"Lucas Elias Baccan","title":"Autor do Site","url":"https://github.com/lucasbaccan","imageURL":"https://github.com/lucasbaccan.png","key":"LucasEliasBaccan","page":null}],"frontMatter":{"slug":"4","title":"#4 - Home Lab","authors":["LucasEliasBaccan"],"tags":["2023","06/2024","Lucas","Elias","Baccan"],"hide_table_of_contents":false},"unlisted":false,"nextItem":{"title":"#3 - Cursos","permalink":"/blog/3"}},"content":"import Center from \\"@site/src/components/Center\\";\\n\\n## Home Lab\\n\\nEm 2024 eu e minha noiva fizemos uma viagem para o Canad\xe1 e Estados Unidos. Como todo bom turista, aproveitei para fazer compras e comprei alguns computadores usados para montar meu [Home Lab](/info/setup#home-lab).\\n\\n\x3c!-- truncate --\x3e\\n\\n## Viagem\\n\\nPegamos um pacote de 10 dias, e por ser a primeira viagem fora da Am\xe9rica do Sul, optamos por passar em varias cidades. Nosso pacote come\xe7ava em Montreal e terminava em Nova York. As cidade que passamos foram:\\n\\n- Montreal, Canad\xe1\\n- Quebec, Canad\xe1\\n- Mont Tremblant, Canad\xe1\\n- Ottawa, Canad\xe1\\n- Toronto, Canad\xe1\\n- Niagara Falls, Canad\xe1\\n- Niagara Falls, EUA\\n- Corning, EUA\\n- Nova York, EUA\\n\\n## Dinheiro\\n\\nPara essa viagem, n\xf3s levamos um pouco de dinheiro em esp\xe9cie, algo em torno de 300 d\xf3lares americanos, o que \xe9 pouco, mas o suficiente para emerg\xeancias. O restante do dinheiro foi em cart\xe3o de d\xe9bito, que usamos para pagar a maioria das coisas.\\n\\nMinha noiva levou o cart\xe3o da [Nomad](https://www.nomadglobal.com/), que \xe9 um cart\xe3o de d\xe9bito internacional, que estava cadastrado na carteira digital do celular dela. Eu levei o cart\xe3o da [Wise](https://wise.com/), que \xe9 um cart\xe3o de d\xe9bito internacional, que tamb\xe9m estava cadastrado na minha carteira digital, mas eles mandaram um cart\xe3o f\xedsico, que eu levei junto. Ambos os cart\xf5es converteram a moeda local para d\xf3lar americano, e a convers\xe3o foi feita no momento da compra.\\n\\nUm ponto importante \xe9 que o bom de ter o cart\xe3o f\xedsico \xe9 que deu para sacar dinheiro em caixas eletr\xf4nicos (ATMs), pois iria precisar para pagar os computadores que queria.\\n\\n## Ebay\\n\\nMinha escolha para comprar os computadores foi o [Ebay](https://www.ebay.com/), pois l\xe1 tem muitos vendedores, ent\xe3o filtrei por vendedores na regi\xe3o de Nova York, pois era a \xfaltima cidade que iria passar e entrei em contato com alguns vendedores.\\n\\nFiz o contato ainda no Brasil, falei que iria viajar, que ainda n\xe3o tinha o nome do hotel, mas que tinha interesse, e come\xe7amos a negociar, ele fez $100.00 d\xf3lares cada, j\xe1 que levaria 3. Ele pediu para eu chamar ele quando estivesse para chegar em Nova York, e assim fiz.\\n\\n<Center>\\n\\n![Ebay](./imagem1.png)  \\nAn\xfancio no Ebay\\n\\n\\n</Center>\\n\\n## Entrega\\n\\nEu tinha pego um chip no Canada, mas por ser o primeiro dia nos Estados Unidos, n\xe3o tinha ainda pego um chip de celular, ent\xe3o s\xf3 conseguia me comunicar pelo Wi-Fi dos lugares. Combinamos de realizar a entrega no hotel, eu passei o endere\xe7o e falei mais ou menos o hor\xe1rio que iria chegar, perto das 22:00. Porem o \xf4nibus acabou atrasando, e quando chegamos, quando conectei no Wi-Fi, vi que o vendedor tinha mandado mensagem falando que estava j\xe1 esperando e que se n\xe3o chegasse em 30 minutos, iria embora, pois precisava trabalhar no dia seguinte e j\xe1 estava tarde.\\n\\nCorri ent\xe3o pra rua a procura da placa do carro dele, estava a alguns metros do hotel, e quando cheguei, me apresentei e falei que tinha atrasado por conta do \xf4nibus, ele me mostrou os computadores e entreguei o dinheiro a ele, depois ele comentou que pensou que poderia ser um golpe, que ningu\xe9m iria aparecer, pois eu era um estranho de outro pa\xeds, que poderia s\xf3 estar pregando uma pe\xe7a nele, mas ele ficou feliz e foi tranquilo a entrega.\\n\\n## Computadores\\n\\nComprei 3 Lenovo [ThinkCentre M900 Tiny](/files/m900_tiny_platform_spec.pdf), que s\xe3o computadores pequenos, que tem um processador [Intel i5-6500T](https://www.intel.com.br/content/www/br/pt/products/sku/88183/intel-core-i56500t-processor-6m-cache-up-to-3-10-ghz/specifications.html) - 4 n\xfacleos / 4 threads (2.5 GHz / 3.1 GHz), 16 GB de RAM (1x16 GB) 2133 mhz (Um deles \xe9 2x8 GB) e 512 GB NVMe (TeamGroup). \\n\\n<Center>\\n\\n![Computadores](./imagem2.jpg)  \\nCompara\xe7\xe3o deles com um rel\xf3gio\\n\\n</Center>\\n\\n## Viagem de volta\\n\\nNa volta, coloquei os computadores na mala, no meio das roupas, para que n\xe3o batessem e n\xe3o quebrassem. Eles chegaram bem, e agora est\xe3o na minha mesa, esperando para serem configurados.\\n\\n<Center>\\n\\n![Computadores](./imagem3.jpg)  \\nFoi um sufoco guardar todas as coisas da viagem na mala\\n\\n</Center>\\n\\nChegando no Brasil, no aeroporto, fomos selecionados de forma \\"aleat\xf3ria\\" (\ud83e\udd37) para passar por uma revista, pediram o que tinha na mala, falei que eram 3 computadores, e nem pediram para abrir a mala. Foi mais tranquilo do que eu esperava.\\n\\n:::info Nota\\nVoc\xea pode trazer 1000 d\xf3lares em produtos sem pagar imposto, e pode ter at\xe9 3 produtos iguai, ent\xe3o eu estava dentro da lei. Al\xe9m disso eu tinha feito a Declara\xe7\xe3o Eletr\xf4nica de Bens do Viajante [(e-DBV](https://www.gov.br/receitafederal/pt-br/assuntos/aduana-e-comercio-exterior/viagens-internacionais/guia-do-viajante/e-dbv)), mas n\xe3o era necess\xe1rio, pois estava dentro do limite de valor e quantidade.\\n:::\\n\\n## Conclus\xe3o\\n\\nV\xe1rias vezes eu ficava pensando se iria dar certo ou n\xe3o a compra, se iria ser enganado ou roubado, mas no final deu tudo certo, e isso n\xe3o tirou o brilho da viagem que foi incr\xedvel. Deu para conhecer v\xe1rias cidades, v\xe1rias culturas e se divertir muito. J\xe1 estou ansioso para a pr\xf3xima viagem.\\n\\n<Center>\\n\\n![Computadores](./imagem4.jpg)  \\nCentral Park, Nova York - 31/05/2024\\n\\n</Center>"},{"id":"3","metadata":{"permalink":"/blog/3","editUrl":"https://github.com/lucasbaccan/code/tree/master/blog/2024-03-23-blog-3/index.md","source":"@site/blog/2024-03-23-blog-3/index.md","title":"#3 - Cursos","description":"Novo tutorial","date":"2024-03-23T00:00:00.000Z","tags":[{"inline":true,"label":"2023","permalink":"/blog/tags/2023"},{"inline":true,"label":"03/2024","permalink":"/blog/tags/03-2024"},{"inline":true,"label":"Lucas","permalink":"/blog/tags/lucas"},{"inline":true,"label":"Elias","permalink":"/blog/tags/elias"},{"inline":true,"label":"Baccan","permalink":"/blog/tags/baccan"}],"readingTime":0.28,"hasTruncateMarker":false,"authors":[{"name":"Lucas Elias Baccan","title":"Autor do Site","url":"https://github.com/lucasbaccan","imageURL":"https://github.com/lucasbaccan.png","key":"LucasEliasBaccan","page":null}],"frontMatter":{"slug":"3","title":"#3 - Cursos","authors":["LucasEliasBaccan"],"tags":["2023","03/2024","Lucas","Elias","Baccan"],"hide_table_of_contents":true},"unlisted":false,"prevItem":{"title":"#4 - Home Lab","permalink":"/blog/4"},"nextItem":{"title":"#2 - Novo tutorial","permalink":"/blog/2"}},"content":"## Novo tutorial\\n\\nFala pessoal\\n\\nCriei um novo menu no site chamado **[Cursos](/cursos)**, onde vou colocar conte\xfados de cursos que eu fiz e que acho interessante compartilhar com voc\xeas. Atualmente eu estou fazendo o [curso.dev](/cursos/curso-dev) do Felipe Deschamps e o [pick 2024](/cursos/pick-2024) do Jeferson Fernando.\\n\\nEspero que gostem, e que aproveitem o conte\xfado.\\n\\nAt\xe9 a pr\xf3xima."},{"id":"2","metadata":{"permalink":"/blog/2","editUrl":"https://github.com/lucasbaccan/code/tree/master/blog/2023-12-23-blog-2/index.md","source":"@site/blog/2023-12-23-blog-2/index.md","title":"#2 - Novo tutorial","description":"Novo tutorial","date":"2023-12-23T00:00:00.000Z","tags":[{"inline":true,"label":"2023","permalink":"/blog/tags/2023"},{"inline":true,"label":"12/2023","permalink":"/blog/tags/12-2023"},{"inline":true,"label":"Lucas","permalink":"/blog/tags/lucas"},{"inline":true,"label":"Elias","permalink":"/blog/tags/elias"},{"inline":true,"label":"Baccan","permalink":"/blog/tags/baccan"}],"readingTime":0.425,"hasTruncateMarker":false,"authors":[{"name":"Lucas Elias Baccan","title":"Autor do Site","url":"https://github.com/lucasbaccan","imageURL":"https://github.com/lucasbaccan.png","key":"LucasEliasBaccan","page":null}],"frontMatter":{"slug":"2","title":"#2 - Novo tutorial","authors":["LucasEliasBaccan"],"tags":["2023","12/2023","Lucas","Elias","Baccan"],"hide_table_of_contents":true},"unlisted":false,"prevItem":{"title":"#3 - Cursos","permalink":"/blog/3"},"nextItem":{"title":"#1 - Primeiro post","permalink":"/blog/1"}},"content":"## Novo tutorial\\n\\nFala pessoal\\n\\nDepois de muito tempo sem postar nada, resolvi atualizar a documenta\xe7\xe3o sobre Git que eu tinha feito aqui no site. Ela estava muito tecnica e com poucas imagens, ent\xe3o resolvi reescrever ela do zero, deixando mais simples, com mais imagens e mais f\xe1cil de entender.\\n\\nAcesse o tutorial [clicando aqui](/tutorial/git/).\\n\\nFoi criado tamb\xe9m um guia r\xe1pido de comandos do Git, que voc\xea pode acessar [clicando aqui](/tutorial/git/guia_rapido).\\n\\nEspero que gostem, desejo a todos um feliz natal e um \xf3timo ano novo."},{"id":"1","metadata":{"permalink":"/blog/1","editUrl":"https://github.com/lucasbaccan/code/tree/master/blog/2022-09-30-blog-1/index.md","source":"@site/blog/2022-09-30-blog-1/index.md","title":"#1 - Primeiro post","description":"Primeiro post","date":"2022-09-30T00:00:00.000Z","tags":[{"inline":true,"label":"2022","permalink":"/blog/tags/2022"},{"inline":true,"label":"09/2022","permalink":"/blog/tags/09-2022"},{"inline":true,"label":"Lucas","permalink":"/blog/tags/lucas"},{"inline":true,"label":"Elias","permalink":"/blog/tags/elias"},{"inline":true,"label":"Baccan","permalink":"/blog/tags/baccan"}],"readingTime":0.445,"hasTruncateMarker":false,"authors":[{"name":"Lucas Elias Baccan","title":"Autor do Site","url":"https://github.com/lucasbaccan","imageURL":"https://github.com/lucasbaccan.png","key":"LucasEliasBaccan","page":null}],"frontMatter":{"slug":"1","title":"#1 - Primeiro post","authors":["LucasEliasBaccan"],"tags":["2022","09/2022","Lucas","Elias","Baccan"],"hide_table_of_contents":true},"unlisted":false,"prevItem":{"title":"#2 - Novo tutorial","permalink":"/blog/2"}},"content":"## Primeiro post\\n\\nFala pessoal\\n\\nLa em outubro de 2020, eu criei esse site, com a inten\xe7\xe3o de colocar alguns conte\xfados relacionados a tecnologia. A ideia veio, mas ficou parada. Agora quase 2 anos depois, vou voltar com a ideia, quem sabe agora de certo \ud83d\ude00.\\n\\nA inten\xe7\xe3o \xe9 tornar os site que eu favoritar, sugest\xf5es e solicita\xe7\xf5es de amigos em conte\xfados aqui, conte\xfados dos quais sejam uteis e facilitem no nosso dia a dia.\\n\\nEnt\xe3o seja bem vindo, adicione aos favoritos e se prepare para conte\xfados incr\xedveis.\\n\\n![programmer.png](programmer.png)"}]}}')}}]);